import React, { Component } from 'react';
class Markers extends Component{
    constructor(props) {
        super(props);
        this.mymap = props.__map__;
        this.marker1 = new window.AMap.Marker({
            position: new window.AMap.LngLat(116.515664,39.908495),
        });
        this.marker2 = new window.AMap.Marker({
            position: new window.AMap.LngLat(116.401216,39.90778),
        });
