        });
        this.marker7 = new window.AMap.Marker({
            position: new window.AMap.LngLat(116.461841,39.909104),
        });
        this.marker8 = new window.AMap.Marker({
            position: new window.AMap.LngLat(116.433147,39.924429),
        });
    }


    componentDidMount(){
        this.mymap.add(this.marker1);
        this.mymap.add(this.marker2);
        this.mymap.add(this.marker3);
        this.mymap.add(this.marker4);
        this.mymap.add(this.marker5);
        this.mymap.add(this.marker6);
        this.mymap.add(this.marker7);
        this.mymap.add(this.marker8);
    }


    render(){
        return (null)
    }
}

export default Markers;
